import Head from "next/head";
import React, { useState, useEffect } from "react";

import Axios from "axios";

function Page() {
  const [loading, setLoading] = useState(false);
  const [data, setData] = useState();
  const url = "https://aguaviva-rp.firebaseio.com/movimentacoes/2019.json";

  useEffect(() => {
    setLoading(true);
    Axios.get(url).then((res) => {
      setData(res.data);
      setLoading(false);
    });
  }, []);
  if (loading) {
    return <p>Loadding</p>;
  }
  return (
    <>
      <div>teste</div>
      {JSON.stringify(data)}
    </>
  );
}

export default Page;
